import React from 'react';
import './ProjectManagementCard.css';

const ProjectManagementCard = () => (
  <div className="project-management-card">
    <div className="pm-title">إدارة المشاريع</div>
    <div className="pm-content">
      <span>عرض جميع المشاريع</span>
      <span className="pm-filter">فلترة حسب الحالة والدفع</span>
    </div>
  </div>
);

export default ProjectManagementCard;
